import React, { useState } from "react";
import './Register.css';
// import { Form } from 'react-router-dom';

const Register = ({ domain }) => {
  const [username, setUsername] = useState('');

  const handleChange = (event) => {
    setUsername(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    // Generate the email address based on the username and domain.
    const email = `${username}@${domain}`;

    // Do something with the data, such as sending it to the backend.
  };

  return (
    <div id='register' className='register'>
      <div className='card'>
      <form>
        <div className='row'>
        <div className='col-5'>
        <label className='labelfull'>Full Name:
        <input type='text' className='fullname'></input>
        </label>
        </div>
        <div className='col-5'>
        <label className='labellast'>Last Name:
        <input type='text' className='lastname'></input>
        </label>
        </div>
        </div>
        <br />
        <div className='row'>
        <div className='col-5'>
        <label htmlFor='username' className='labelemail'>Username:
        <input type="text" className='email' value={username} onChange={handleChange} />{username}@{domain}
        </label>
        </div>
        <div className='col-5'>
        <label className='labelpassword'>Password:
        <input type="email" className='password' name="email"></input>
        </label>
        </div>
        </div>
      </form>
      </div>
      </div>
  )
}

export default Register
